def transform(sequence):
    sequence_list = list(sequence)
    left_index, right_index = 0, len(sequence_list) - 1

    # Check from left if the element is zero 
    while sequence_list[left_index] != "0":
        left_index += 1

    # Check from right if the element is zero
    while sequence_list[right_index] == "0":
        right_index -= 1

    # Now left_index is at first zero and right_index is at last non-zero
    return "".join(sequence_list[left_index:right_index+1] + sequence_list[:left_index] + sequence_list[right_index+1:])
